import React, { Component } from 'react';
import BrokerData from "../components/Brokers/BrokerData";
import {Grid} from "@material-ui/core";
import Button from '@material-ui/core/Button';
import Popup from "../components/Popup";
import './styles.css';

class BrokersContainer extends Component {

    constructor(props){
        super(props);
        this.state = { showPopup: false };
    }

    togglePopup() {
        this.setState({
            showPopup: !this.state.showPopup
        });
    }

    render() {
        return (
            <Grid>
                <h4>Brokers:</h4>
                <Button aria-controls="simple-menu" aria-haspopup="true" onClick={this.togglePopup.bind(this)}>
                    Create Broker
                </Button>
                <div className='cont-broker-data'>
                    <BrokerData></BrokerData>
                </div>
            </Grid>
        )
    }
}

export default BrokersContainer;
